.card {
  color: #ffffff;
  background: url("/0f70025838bb796307434f2b01fdffb8.jpg");
  -webkit-background-size: cover;
  background-size: cover;
  padding: 10rem 0 0;
  min-width: 16.625rem;
  max-width: 20.625rem;
  border-radius: 0.5rem;
  overflow: hidden;
  transition: transform 500ms ease;
}
.card:hover, .card:focus, .card:focus-within {
  transform: scale(1.05);
}
.card:hover .card-title::after, .card:focus .card-title::after {
  transform: scaleX(1);
}
@media (hover) {
  .card:hover .card-content, .card:focus-within .card-content {
    transform: translateY(0);
    transition-delay: 500ms;
  }
}
.card:focus-within .card-content {
  transition-delay: 0ms;
}
@media (hover) {
  .card:hover .card-content > *:not(.card-title), .card:focus-within .card-content > *:not(.card-title), .card:focus .card-content > *:not(.card-title) {
    opacity: 1;
    transition-delay: 800ms;
  }
}
.card .button {
  background: #42f584;
  color: #13171b;
  font-weight: 600;
  border-radius: 0.25rem;
  cursor: pointer;
}
.card .button:hover, .card .button:focus {
  background: #ffffff;
}
.card-content {
  background: linear-gradient(rgba(0, 0, 0, 0), rgba(0, 0, 0, 0.3) 20%, black);
}
@media (hover) {
  .card-content {
    transform: translateY(70%);
    transition: transform 500ms ease;
  }
  .card-content:hover .card-content-content, .card-content:focus-within .card-content-content {
    transform: translateY(0);
    transition-delay: 500ms;
  }
  .card-content > *:not(.card-title) {
    opacity: 0;
    transition: opacity 500ms linear;
  }
}
.card-title {
  position: relative;
  display: inline-block;
  font-weight: 600;
}
.card-title::after {
  content: "";
  position: absolute;
  height: 4px;
  background: #42f584;
  left: calc(1.5rem * -1);
  bottom: -2px;
  width: calc(100% + 1.5rem);
  transform-origin: left;
  transition: transform 500ms ease;
}
@media (hover) {
  .card-title::after {
    transform: scaleX(0);
  }
}

