// reset all browser styles to achieve a consistent feel across all browsers

/**
 * Removes the default spacing and border for appropriate elements.
 */
body,
blockquote,
dl,
dd,
h1,
h2,
h3,
h4,
h5,
h6,
hr,
figure,
p,
pre {
  margin: 0;
  padding: 0;
}

button {
  background-color: transparent;
  background-image: none;
}

fieldset {
  margin: 0;
  padding: 0;
}

ol,
ul {
  list-style: none;
  margin: 0;
  padding: 0;
}

// set base line height
html {
  line-height: 1.5;
}

// set box sizing to border box for all elements
*,
::before,
::after {
  box-sizing: border-box;
}

// give buttons with the role of button cursor pointer
button,
[role="button"] {
  cursor: pointer;
}

// reset font sizes
h1,
h2,
h3,
h4,
h5,
h6 {
  font-size: inherit;
  font-weight: inherit;
}

//remove default link styling
a {
  color: inherit;
  text-decoration: none;
}
// set these elements to display block
img,
svg,
video,
canvas,
audio,
iframe,
embed,
object {
  display: block; /* 1 */
}
// set images and videos to the size of parent containers and preserve aspect ratio
img,
video {
  max-width: 100%;
  height: auto;
}

