// all global variables

// default font size for px to em conversion
$browser-context: 16;

// map of breakpoint sizes
$breakpoints: (
        sm: 36em, // 576px
        md: 48em, // 768px
        lg: 62em, // 992px
        xl: 78.75em, // 1260px
);

// set font stack
$ff: 'Nunito Sans', sans-serif;
$fw-base: 400;
$fw-semibold: 600;
$fw-bold: 800;

// set font sizes - https://type-scale.com/?size=16&scale=1.333&text=A%20Visual%20Type%20Scale&font=Nunito%20Sans&fontweight=800&bodyfont=body_font_default&bodyfontweight=400&lineheight=1.75&backgroundcolor=%23ffffff&fontcolor=%23000000&preview=false
$type-scale: (
        sm: 0.75rem,
        base: 1rem,
        md: 1.333rem,
        lg: 1.777rem,
        xl: 2.369rem,
        '2xl': 3.157rem,
        '3xl': 4.209rem,
);

//grid
$grid-columns:12;

$spacing: (
        '0': 0px,
        'px': 1px,
        '1': 0.125rem,
        '2': 0.25rem,
        '3': 0.375rem,
        '4': 0.5rem,
        '5': 0.625rem,
        '6': 0.75rem,
        '7': 0.875rem,
        '8': 1rem,
        '9': 1.25rem,
        '10': 1.5rem,
        '11': 1.75rem,
        '12': 2rem,
        '13': 2.25rem,
        '14': 2.5rem,
        '15': 2.75rem,
        '16': 3rem,
        '17': 3.5rem,
        '18': 4rem,
        '19': 5rem,
        '20': 6rem,
        '21': 7rem,
        '22': 8rem,
);

