sources.scss/partials/sections/_projects.scss:
.projects {
  min-height: 100vh;
  & .row {
    justify-content: flex-start;
    @include mq(md) {

    justify-content: center;
    }
  }
}
.card {
  color: c(white);
  background: url("../img/card-bg.jpg");
  -webkit-background-size: cover;
  background-size: cover;
  padding: 10rem 0 0;
  min-width: rem(266);
  max-width: rem(330);
  border-radius: .5rem;
  overflow: hidden;
  transition: transform 500ms ease;
  &:hover,
  &:focus,
  &:focus-within {
    transform: scale(1.05);
  }
  &:hover &-title::after,
  &:focus &-title::after {
    transform: scaleX(1);
  }
  &:hover &-content,
  &:focus-within &-content{
    @include mqh() {
      transform: translateY(0);
      transition-delay: 500ms;
    }
  }
  &:focus-within &-content {
    transition-delay: 0ms;
  }
  &:hover &-content > *:not(.card-title),
  &:focus-within &-content > *:not(.card-title),
  &:focus &-content > *:not(.card-title){
    @include mqh() {
      opacity: 1;
      transition-delay: 800ms;
    }

  }
  & .button {
    background: c(accent);
    color: c(grey-900);
    font-weight: $fw-semibold;
    border-radius: 0.25rem;
    cursor: pointer;
    &:hover, &:focus {
      background: c(white);
    }
  }
  &-content {
    background: linear-gradient(
                    rgba(0, 0, 0, 0),
                    rgba(0, 0, 0, 0.3) 20%,
                    rgba(0, 0, 0, 1)
    );
    @include mqh() {
      transform: translateY(70%);
      transition: transform 500ms ease;
      &:hover &-content,
      &:focus-within &-content, {
        transform: translateY(0);
        transition-delay: 500ms;
    }
      & > *:not(.card-title) {
        opacity: 0;
        transition: opacity 500ms linear;
      }
    }
  }
  &-title {
    position: relative;
    display: inline-block;
    font-weight: $fw-semibold;
    &::after {
      content: '';
      position: absolute;
      height: 4px;
      background: c(accent);
      left: calc(1.5rem * -1);
      bottom: -2px;
      width: calc(100% + 1.5rem);
      transform-origin: left;
      transition: transform 500ms ease;
      @include mqh() {
      transform: scaleX(0);
    }
    }

  }
}
